import React, { useState, useContext } from "react";
import { ThemeContext } from "../../context/Theme";
import ViewNotification from "../../components/ui/ViewNotification";

{
  /*Get Props*/
}
export const AdminViewNotification = ({ setSelected }) => {
  const [theme, setTheme] = useContext(ThemeContext);

  return (
    <div
      className={`col-span-8 overflow-hidden rounded-lg text-xs md:text-md w-64 px-8 sm:w-full `}
    >
      <div className="flex justify-end px-9 py-3">
        <button
          onClick={() => {
            setSelected("EditNotification");
          }}
          className="absolute top-0 left-0  m-4 px-4 py-2 text-green-500 rounded-lg"
        >
          <i class="fa-solid fa-pen-to-square text-2xl"></i>
        </button>
      </div>
      <ViewNotification setSelected={setSelected} />
    </div>
  );
};
